import React, { Component } from "react";
import LoadingComponent from "./loading";
import NavComponent from "./navcomponent";
import NetworkNavigator from "./navigator";

class TiktokComponent extends Component {
  constructor(props) {
    super(props);
    this.fetchLink = `https://artefaktasnodeserver.herokuapp.com/tiktokvideos`;
    this.state = {
      tiktokdata: null,
    };
  }

  componentDidMount() {
    const fetchUrl = this.fetchLink;
    async function fetchTikTok() {
      const res = await fetch(fetchUrl);
      const jsonRes = await res.json();
      return jsonRes;
    }

    fetchTikTok().then((dat) => {
      this.setState({ tiktokdata: dat });
    });
  }

  render() {
    return (
      <div>
        this.state.tiktokdata !== null ? this.state.tiktokdata.data.videos !==
        undefined ? this.state.tiktokdata.videos.map((video,index)=>
        {console.log(video)}): <LoadingComponent />
        <NetworkNavigator />
        <NavComponent />
      </div>
    );
  }
}

export default TiktokComponent;
